import React from "react";
import Aboutus from "./Aboutus";
import Header from "./Header";
import HowItWorks from "./HowItWorks";
import Navbar from './Navbar';


const App = () => {
  return (
    <>
      <Navbar />
      <Header />
      <HowItWorks />
      <Aboutus />
    </>
  );
};

export default App;
